class HomeComponent {
    constructor(dataService) {
        this.dataService = dataService;
        this.totalConfirmed = 0;
        this.totalActive = 0;
        this.totalDeaths = 0;
        this.totalRecovered = 0;
        this.loading = true;
        this.datatable = [];
        this.chart = {
            PieChart: "PieChart",
            ColumnChart: 'ColumnChart',
            height: 700,
            width: 700,
            options: {
                hAxis: {
                    title: 'Country'
                },
                vAxis: {
                    title: 'Cases'
                },
                animation: {
                    duration: 1000,
                    easing: 'out',
                },
            }
        };
    }
    ngOnInit() {
        this.dataService.getGlobalData()
            .subscribe({
            next: (result) => {
                this.globalData = result;
                result.forEach(cs => {
                    if (!Number.isNaN(cs.confirmed)) {
                        this.totalActive += cs.active;
                        this.totalConfirmed += cs.confirmed;
                        this.totalDeaths += cs.deaths;
                        this.totalRecovered += cs.active;
                    }
                });
                this.initChart('c');
            },
            complete: () => {
                this.loading = false;
            }
        });
    }
    updateChart(input) {
        this.initChart(input.value);
    }
    initChart(caseType) {
        this.datatable = [];
        // this.dataTable.push(["Country", "Cases"]);
        // Sorting the data, according to the cases...
        this.globalData.sort((a, b) => b.confirmed - a.confirmed);
        this.globalData.forEach(cs => {
            let value;
            if (caseType == 'c')
                if (cs.confirmed > 200000)
                    value = cs.confirmed;
            if (caseType == 'a')
                if (cs.active > 200000)
                    value = cs.active;
            if (caseType == 'd')
                if (cs.deaths > 50000)
                    value = cs.deaths;
            if (caseType == 'r')
                if (cs.recovered > 200000)
                    value = cs.recovered;
            if (value != undefined) {
                this.datatable.push([
                    cs.country, value
                ]);
            }
        });
    }
}
